import React from 'react';
import "./css/header.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGift, faLocationArrow, faMobileAlt, faQuestion, faQuestionCircle } from '@fortawesome/free-solid-svg-icons';
import {Container,Row,Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


function Head(){
   return(
    <div className="head">
        <Container fluid>
            <Row>
                <Col>1 of 1</Col>
                <Col><p><FontAwesomeIcon icon={faMobileAlt}/> Get it | <FontAwesomeIcon icon={faLocationArrow}/>Store & Events | <FontAwesomeIcon icon={faGift}/>Gift Card | <FontAwesomeIcon icon={faQuestionCircle}/>Help </p>
                </Col>
            </Row>
        </Container>
    </div>
   ) ;
}
export default Head;
